	cursor: pointer;

	padding: 0 0 0 30px;
	margin: 0;
	// padding: 0;

	font-family: Montserrat;
	font-style: normal;
	text-align: left;
	font-size: 14px;
	line-height: 18px;
	font-weight: 400;
	// text-transform: uppercase;
	color: opacify($DarkShade, 0.5);
}
.checkboxButtons__text:before {
	content: '';

	position: absolute;
	top: 0px;
	left: 0;

	width: 20px;
	height: 20px;

	background: #FFFFFF;

	border: 1px solid opacify($DarkShade, 0.25);
	box-sizing: border-box;
	border-radius: 4px;
}
.checkboxButtons__text:after {
	content: '';
	z-index: -1;

	position: absolute;
	top: 5px;
	left: 7px;

	width: 6px;
	height: 8px;

	background: #FFFFFF;
	border-width: 2px;
	border-style: solid;
	border-image: $PurpleGradient 1;
	box-sizing: border-box;

	border-top: none;
	border-left: none;

	transform: rotate(45deg);
	-webkit-transform: rotate(45deg);
}
.checkboxButtons input:checked + .checkboxButtons__text:before {
	content: '';

	position: absolute;
	top: 0px;
	left: 0px;

	width: 20px;
	height: 20px;

	background: #FFFFFF;

	border: 1px solid opacify($Purple, 1);
	box-sizing: border-box;
	border-radius: 4px;
}
.checkboxButtons input:checked + .checkboxButtons__text:after {
	z-index: 1;
}

.checkboxButtons input:focus + .checkboxButtons__text:before {
    box-shadow: 0px 0px 0px 1px $FocusColor;
}

