	margin: 0;
	padding: 0;
	
	width: auto;
	height: 24px;

    display: flex;
	flex-wrap: wrap;
	
	list-style: none;
    text-decoration: none;
}

.defaultRadioButtons__listElement {
	margin: 0;
    padding: 0;
}

.defaultRadioButtons__button input {
	position: absolute;
	z-index: -1;
	opacity: 0;
	margin: 10px 0 0 7px;
}

.defaultRadioButtons__title {
	position: relative;
	cursor: pointer;
	
	margin: -3px 20px 0 0;
	padding: 0 0 0 30px;
    
	font-family: Montserrat;
	font-style: normal;
	text-align: left;
	font-size: 14px;
	line-height: 24px;
